namespace AdventOfCodeTests.Year2022
{
    public class Day18Tests
    {
        [Test]
        public void SurfaceArea_ShouldFindTheAnswerForSingleCube()
        {
            var boulder = new BoilingBoulders("1, 1, 1");

            var result = boulder.SurfaceArea();

            result.Should().Be(6);
        }

        [Test]
        public void SurfaceArea_ShouldFindThePuzzleAnswerForExample1()
        {
            var boulder = new BoilingBoulders(_exampleInput);

            var result = boulder.SurfaceArea();

            result.Should().Be(64);
        }

        [Test]
        public void SurfaceArea_ShouldFindThePuzzleAnswerForPart1()
        {
            var boulder = new BoilingBoulders(_puzzleInput);

            var result = boulder.SurfaceArea();

            result.Should().Be(3432);
        }

        [Test]
        public void SurfaceArea_ShouldFindThePuzzleAnswerForExample2()
        {
            var boulder = new BoilingBoulders(_exampleInput);
            boulder.AddWater();

            var result = boulder.SurfaceArea('o');

            result.Should().Be(58);
        }

